import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import IntuitData from './components/IntuitData';

function App() {
  return (
    <Router>
      <div>
        <h1>Intuit Data Fetcher</h1>
        <Switch>
          <Route path="/" exact component={IntuitData} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
